import XCTest
@testable import Lodjinha

class HomeBannersViewCellTests: XCTestCase {

    var sut: HomeBannerViewCell!
    
    func test_configureCellWithBanner_setsImageView() {
        sut = HomeBannerViewCell()
        sut.imageView = StubImageView()
        sut.configure(banner: Banner(id: 1, imageUrl: "", linkUrl: ""))
        XCTAssertNotNil(sut.imageView.image)
    }
    
}

class StubImageView: UIImageView {
    
    override func setImage(fromUrl url: String, withIndicator indicator: UIActivityIndicatorView?, defaultImage: UIImage?) {
        self.image = dummyImage
    }
}

var dummyImage: UIImage {
    let base64ImageString = ""
    
    return UIImage(data: Data(base64Encoded: base64ImageString)!)!
}
